import React, {useState} from 'react';

import { StyleSheet, Text, View, FlatList, Image, TouchableOpacity } from 'react-native';

function KatsItem ({preview, cat, id}) {


	return (
	<View style={{
	        backgroundColor: 'rgba(232, 236, 241, 0.5)',
	      }}>>
		<View style={{
			height: 'auto',
	        justifyContent: 'center',
	        alignItems: 'center',
	        padding: 15,
	      }}>
			<Image
          	source={{
            width: 200,
            height: 200,
            uri: preview
        }}
          />
          <View>
	          <Text>
	          {cat}	
	          </Text>
	      </View>	         
		</View>
	</View>	
	)
}

export default KatsItem;
